import { useEffect, useState } from "react";
import  Container  from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import  Table  from "react-bootstrap/Table";
import Button from "react-bootstrap/Button";

const Dashboard =() =>{


    const [employees,setEmployees] = useState([]);
    useEffect( ()=>{
        const fetchEmployees = async () =>{
            try{
                const response = await fetch("http://localhost:8080/api/employees");
                const data = await response.json();

                setEmployees(data)
            }catch(error){
                console.error("error fetching employees:",error.message);
            }
        }

        fetchEmployees();

    },[])

    const handelDelete = async(employeeId) =>{
        try {
            const response = await fetch('http://localhost:8080/api/employee/${employeeId}',{
                method: "DELETE",
            })
            console.log('Employee with ID ${employeeId} delete Successfully');
            
        } catch (error) {
            console.log("Erroe Deleting Employee:",error.message);
        }
    }
    
    return(
        <>
        <Container className="mt-5">
            <Row>
                <Col>
                <h1 className="text-center">Employees</h1>
                <Table striped bordered hover responsive>
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Email</th>
                            <th>phone</th>
                            <th>Department</th>
                            <th>Action</th>
                        </tr>
                    </thead>
                    <tbody>
                        {employees.map((employee)=>(
                            <tr key={employee.id}>
                                <td>{employee.name}</td>
                                <td>{employee.email}</td>
                                <td>{employee.phone}</td>
                                <td>{employee.department}</td>
                                <td>
                                    <Button variant="outline-danger">update</Button>
                                    <Button variant="outline-danger" onclick={()=>handelDelete(employee.Id)}>Delete</Button>
                                </td>
                            </tr>

                        ))}
                    </tbody>
                </Table>
                </Col>
            </Row>

        </Container>
        </>
    )
}
export default Dashboard;
